import React, { useState, useEffect } from 'react'
import axios from 'axios'
function RecipesCards() {
    const [cards, setCards] = useState()
    const [id, setId] = useState(0)

    useEffect(() => {
        axios
            .get('http://localhost:3001/recipesPopular')
            .then(res => {
                // console.log(res)
                setCards(res.data[0])
            })
            .catch(err => {
                console.log(err)
            })
    }, [])

    return (
        <div className='popular'>
            <div id='Card' className="row row-cols-1 row-cols-md-3 g-5 m-2">


                {
                    (cards.length>6) ? cards.map(cards =>
                        <div className="col">
                            <div className="card">
                                <img src={cards.image} className="card-img-top" alt="first Recipe" />
                                <div className="card-body">
                                    <h5 className="card-title">{cards.title}</h5>
                                    <p className="card-text">recipe API</p>
                                </div>
                            </div>
                        </div>)
                        : console.log("error")
                }
            </div>
        </div>
    )

}
export default RecipesCards
